import * as React from "react";
const axios = require("axios");

export default function SignUpMFA() {
  const [qrcodeSrc, setQrcodeSrc] = React.useState("");

  React.useEffect(() => {

  }, []);
  // Make a GET request




  let options = {
    method: "GET",
    url: "https://google-authenticator.p.rapidapi.com/new_v2/",
    headers: {
      "X-RapidAPI-Key": "414bc5d180msh86e5db53aea8bbcp1bcd81jsn6915fb5401f0",
      "X-RapidAPI-Host": "google-authenticator.p.rapidapi.com",
    },
  };

  axios
    .request(options)
    .then(function (response) {
      console.log(response.data);
    })
    .then(function (data) {
      options = {
        method: "GET",
        url: "https://google-authenticator.p.rapidapi.com/enroll/",
        params: {
          secret: "GXPTBCTI4DX4UFJB",
          issuer: "AcmeCorp",
          account: "JohnDoe",
        },
        headers: {
          "X-RapidAPI-Key":
            "414bc5d180msh86e5db53aea8bbcp1bcd81jsn6915fb5401f0",
          "X-RapidAPI-Host": "google-authenticator.p.rapidapi.com",
        },
      };

      axios
        .request(options)
        .then(function (response) {
          setQrcodeSrc(response.data);
        })
        .catch(function (error) {
          console.error(error);
        });
    })
    .catch(function (error) {
      console.error(error);
    });

  return (
    <>
      <h1>Scan the barcode from Google Authenticator</h1>;
      <img src={qrcodeSrc} />
    </>
  );
}
